hterm_pref_character_map_overrides.message:
Esta preferencia especifícase como un obxecto. É unha matriz dispersa, onde cada propiedade é o código do conxunto de caracteres e o valor é un obxecto que é propiamente unha matriz dispersa. Nesa matriz dispersa, cada propiedade é o carácter que se recibe e o valor é o carácter que se mostra.

Por exemplo:
{ "0": {
  "+": "\u2192",
  ",": "\u2190",
  "-": "\u2191",
  ".": "\u2193",
  "0": "\u2588"
} }
